window.bookSummaryJSON = "<p>At the end of Worldbinder, Fallion Orden, son of Gaborn, was imprisoned on a strange and fantastic world that he created by combining two alternate realities. It’s a world brimming with dark magic and ruled by a creature of unrelenting evil, one who is gathering monstrous armies from a dozen planets in a bid to conquer the universe. </p> <p>Only Fallion has the power to mend the worlds, but at the heart of a city that is a vast prison, he lies in shackles. The forces of evil are growing and will soon rage across the heavens. Now, Fallion’s allies must risk everything in an attempt to free him from the wyrmling horde. </p> <p>David Farland is an American author of fantasy fiction. He came to prominence when he won the L. Ron Hubbard Gold Award for <i>On My Way to Paradise.</i> He is also the author of <i>Star Wars</i> novels, of which <i>The Courtship of Princess Leia</i> became a <i>New York Times</i> best seller.</p>"; 
